const countdown = parcel.getFeatureById('countdown')
const parcelId = 2997
const countDownDate = new Date("Feb 23, 2020 19:00:00").getTime()
const SECOND = 1000
const MINUTE = SECOND * 60
const HOUR = MINUTE * 60
const DAY = HOUR * 24
if(countdown) {
  // Set the date we're counting down to

  // Update the count down every 1 second
  var x = setInterval(() => {
    const now = new Date().getTime();
    const distance = countDownDate - now;

    // Time calculations for days, hours, minutes and seconds
    const days = Math.floor(distance / DAY)
    const hours = Math.floor((distance % DAY) / HOUR)
    const minutes = Math.floor((distance % HOUR) / MINUTE)
    const seconds = Math.floor((distance % MINUTE) / 1000)

    const label = days + "d " + hours + "h " + minutes + "m " + seconds + "s ";
    countdown.set({
      text: label
    })
    if (distance < 0) {
      clearInterval(x);
      countdown.set({
        text: '0d 0h 0m 0s'
      })
    }
  }, SECOND);
} else {
  console.log('Cannot find countdown feature')
}

